inputData.transfunc:
data => {
  const {combos} = data;
  const nodes = data.nodes.map(n=>{
    return {
      id:'' + n["id"],
      nodeType: n["type"],
      nodeTypeKeyFromProperties:'type',
      data:n
    }
  })
  const edges = data.edges.map(e=>{
    return {
      source:'' + e["source"],
      target:'' + e["target"],
      edgeType: e["type"],
      edgeTypeKeyFromProperties:'type',
      data:e
    }
  })

  return { nodes, edges,combos }
}
